// global css 
import '../Component/css/style.scss'
import '../Component/css/reactMde.scss'

// import Apollo Client
import {client} from "../Component/apollo-client";

// import  Apollo provider
import { ApolloProvider } from "@apollo/react-hooks";

// Layout Component
import Layout from '../Component/Layout'

export default function MyApp({Component, pageProps }) {
  console.log(pageProps)
 return (
   <ApolloProvider client={client}> 
     <Layout>
          <Component {...pageProps} />
     </Layout>
   </ApolloProvider>

  )
}

export function reportWebVitals(metric) {
  if (metric.label === 'custom') {
    console.log(metric , ' metric') // The metric object ({ id, name, startTime, value, label }) is logged to the console
